      <p>option to delete users</p>
      <p>option to delete institutions</p>
    </div>
  )
}

const mapStateToProps = (state) => {
  return {
    state
  }
}

const mapDispacthToProps = (dispatch) => {
  return {
    dispatch
  }
}

export default connect(mapStateToProps, mapDispacthToProps)(Settings)
